function getDateShowTime(nameTheater) {
  return {
    type: "GET_DATE_SHOWTIME",
    payload: nameTheater,
  };
}
function changeStatusDateByTheater(status) {
  return {
    type: "CHANGE_STATUS_DATE_BY_THEATER",
    status: status,
  };
}
function resetTimeByDate(status) {
  return {
    type: "RESET_TIME_BY_DATE",
    status: status,
  };
}
export { resetTimeByDate };
export { changeStatusDateByTheater };
export { getDateShowTime };
